Step-by-step reasoning:
1. Key psychological mechanisms: Responder decisions are thought to be influenced by fairness considerations measured against a fairness benchmark computed as the share of the combined earnings that “should” belong to the participant. Offers above this benchmark may yield an extra “bonus”, whereas offers below produce a penalty. However, the impact of deviations from fairness may saturate – i.e. small deviations matter more than very large ones. This saturation can be captured with a hyperbolic tangent function, reflecting the idea that beyond a certain point extra unfairness does not further change the subjective evaluation.
2. Interaction of mechanisms: The offer (split_self) is compared against a fairness reference f = (token_self/(token_self+token_opp))*combined_earning. The difference Δ = split_self − f drives a bonus if Δ is positive (more than the fairness share) and a penalty if negative. To allow for potentially different sensitivities, we include two learnable parameters: one (eta) weights the bonus for above-fair offers and another (lambda_param) weights the penalty for below-fair offers. The use of tanh ensures that the bonus or penalty saturates in magnitude.
3. Mathematical form: The utility of acceptance (U_accept) is defined as the offered amount (split_self) plus a fairness adjustment term that depends on f, tanh(Δ/f) and the sign of Δ, multiplied by the respective sensitivity parameter. Expressing this in a piecewise but compact form allows capturing both directions (advantage, disadvantage) with two parameters.
4. Parameters needed: Two learnable parameters – eta for responsiveness to beneficial deviations and lambda_param for responsiveness to detrimental deviations – are sufficient to capture the difference in sensitivity. Their bounds are chosen generously (e.g. between 0 and 10).
5. Mapping to observable behavior: The model uses observable quantities (split_self, token_self, token_opp, combined_earning) to compute a fairness reference and then calculates a utility. This utility, when passed through a decision rule (with stochasticity handled separately), predicts whether the participant accepts the offer. All variables in the formula are available in the provided dataset.

Below is the formal specification.

<MODEL>
Let f = (token_self / (token_self + token_opp)) * combined_earning  
Let Δ = split_self - f  
Define Δ_positive = max(Δ, 0) and Δ_negative = max(-Δ, 0)  
Then, the utility of accepting an offer is given by:  
U_accept = split_self + f * ( eta * tanh( Δ_positive / f ) - lambda_param * tanh( Δ_negative / f ) )
</MODEL>

